import { useState } from 'react';


const PatientRegistration = () => {


    const [registration, setRegistration] = useState();

    const inputHandler = (e) => {
        const name = e.target.name;
        const value = e.target.name;
        setRegistration({...registration, [name]: value});
    }

    const submitHandler = (e) => {
        e.preventDefault();
        e.stopPropagation();

        const patient_id = document.getElementsByName('patient_id').value;
        const name = document.getElementsByName('name').value;
        const email = document.getElementsByName('email').value;
        const password = document.getElementsByName('password').value;
        const confirm_password = document.getElementsByName('confirm_password').value;
        const aadhar = document.getElementsByName('aadhar').value;
        const city = document.getElementsByName('city').value;


    }

    return (
        <form action="" method="post">
            <p>Please fill in this form to create an account!</p>
            <hr/>
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="text" class="form-control" name="patient_id" placeholder="Patient ID" required="required" onChange={inputHandler}/></div>
                    <div class="col"><input type="text" class="form-control" name="name" placeholder="Name" required="required" onChange={inputHandler}/></div>
                </div>
            </div>
            <div class="form-group">
                <input type="email" class="form-control" name="email" placeholder="Email" required="required" onChange={inputHandler}/>
            </div>
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="password" class="form-control" name="password" placeholder="Password" required="required" onChange={inputHandler} /></div>
                    <div class="col"><input type="password" class="form-control" name="confirm_password" placeholder="Confirm Password" required="required" onChange={inputHandler} /></div>
                </div>
            </div>
            <div class="form-group">
                <input type="text" class="form-control" name="mobile" placeholder="Mobile" required="required" onChange={inputHandler}/>
            </div>
            <div class="form-group">
                <input type="text" class="form-control" name="aadhar" placeholder="Aadhar" required="required" onChange={inputHandler}/>
            </div>
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="text" class="form-control" name="address" placeholder="Address" required="required" onChange={inputHandler}/></div>
                    <div class="col-4"><input type="text" class="form-control" name="city" placeholder="City" required="required" onChange={inputHandler}/></div>
                </div>
            </div>    
            <div class="form-group">
                <input type="text" class="form-control" name="confirm_password" placeholder="Date of Birth" required="required" onChange={inputHandler} />
            </div>
            <div class="form-group">
                <label class="form-check-label"><input type="checkbox" required="required"/> I hereby declare that the above information is true to the best of my knowledge.</label>
            </div>
            <div class="form-group">
                <button type="submit" class="btn btn-primary btn-lg text-dark" onSubmit={submitHandler}>Sign Up</button>
            </div>
        </form>
    )
}

export default PatientRegistration
